INSERT INTO `aspirante` (`idaspirante`, `uuid`, `primer_nombre`, `segundo_nombre`, `primer_apellido`, `segundo_apellido`, `numero_documento`, `telefono`, `telefono_fijo`, `fecha_nacimiento`, `foto`, `Descripcion`, `hoja_de_vida`, `profesion`, `correo`, `clave`, `salt`, `tipo_documento`, `nacionalidad`, `ciudad_residencia`, `sexo`, `formacion`) VALUES
(8, 0x3bd2e321064344eb8b874fa7915e92de, 'Miguel', 'Angel', 'Rios', 'Perez', '61458748', '310333333', '5687458', '1991-02-13', '1585597632814.jpg', '<h2>How to write a CV profile statement from scratch</h2>\r\n<p>When writing your personal profile, ensure it is:</p>\r\n<ul style=\"list-style-type: none;\">\r\n<li style=\"list-style-type: disc;\"><strong>Short</strong>&nbsp;(no more than 6 lines);</li>\r\n<li style=\"list-style-type: disc;\"><strong>Relevant</strong>&nbsp;to the job you are applying for, and;</li>\r\n<li style=\"list-style-type: disc;\">Contains some&nbsp;<strong>real-world examples</strong>.</li>\r\n</ul>\r\n<p><strong>Be bold, be confident and talk about yourself in a positive way.</strong></p>\r\n<p>Your personal profile is not the place to be humble; it is your chance to be noticed and tell the potential employer exactly who you &lsquo;really&rsquo; are and what you can do for them.</p>\r\n<p><strong>Warning:</strong>&nbsp;Do not go &lsquo;over the top&rsquo; and give the impression that you are either very arrogant or simply too good to be true! Keep it balanced and realistic, bearing in mind the needs of the employer.</p>\r\n<p>Click&nbsp;<a href=\"https://www.cvplaza.com/cv-examples/good-bad-cv/\">here</a>&nbsp;if you want to see a bad example of a personal profile.</p>', 'hojadevida3BD2E321064344EB8B874FA7915E92DE.pdf', 'Ingeniero de sistemas', '1@a.com', 'D1D13BEFA4F0E25381C59A59B115D913F310A4BCA251DED1F42C5B7FEB19621F', 0x4a98356c940e2b53447e6e925f4aef2f90c19212, 2, 52, 1, 1, 6),
(9, 0x53622ecdf2c449c9a17350409fd7b2c3, 'Maria', '', 'Gomez', 'Perez', '541154481', '646416161', '15151616', NULL, '1585510808680.jpg', NULL, NULL, NULL, '2@a.com', '66480DC6A2F1ADAB6ED9B1D7EE0F6B6CCB3D90D7796135D6D5A8CE5C2147FB1B', 0xd6064587e954b1af8ee4c7ea5fd3515d52a98cc2, 2, 52, 3, 2, 8),
(10, 0xbb63af56bf86428ea15095cbd9dfdad8, 'michael ', 'daniel ', 'moreno', 'diaz', '1018494165', '3105731968', '7851705', '1997-04-28', '1585610904041.jpg', '<h1>JHHUGUGUGUDSADSasesdfdfsdfsdjnsdfjndsfjnfsdjnfsdjnfdsjndsfjndsfjndsfjkndfsjkndsfjdfsnjkdsnfjksdnfjksdnffjsdknsdjfknsdfjkndsfjkndfsjkndsfnjksdfnjkndsfjkkndfsjkkndfsjkndfsjkdfnjkdfnkj</h1>\r\n<h1>&nbsp;</h1>\r\n<ul>\r\n<li>asdasdaas</li>\r\n<li>asdasd</li>\r\n<li>asd</li>\r\n<li>asd</li>\r\n<li>asd</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>&nbsp;</p>', 'hojadevidaBB63AF56BF86428EA15095CBD9DFDAD8.pdf', 'electrico', '7@a.com', 'AB04117D855F76667C3004F0921FBC387C2F1F037D9DBB5C5A6B131DB9EFB83C', 0xe93712a318180807aee364e98c01b6acf0cc88bd, 2, 52, 1, 1, 6),
